    if(window.outerWidth > 900)
    document.querySelector('.page-banner img').src = 'https://cdn.kgetechnologies.com/images/bg-page-header.jpg';
    else
      if(window.outerWidth <= 900 && window.outerWidth >= 500)
          document.querySelector('.page-banner img').src = 'https://cdn.kgetechnologies.com/images/bg-page-header-tab.jpg';
