function show_search_bar(trigger_icon, search_bar) {
  // Hide the search bar if aldready open.
  if(trigger_icon.classList.contains('open')) {
    trigger_icon.classList.remove('flaticon-delete');
    trigger_icon.classList.add('flaticon-search');
    search_bar.style.display = 'none';
    trigger_icon.classList.remove('open');
    trigger_icon.classList.add('closed');
  }
  // Show the search bar
  else {
      trigger_icon.classList.remove('flaticon-search');
      trigger_icon.classList.add('flaticon-delete');
      search_bar.style.display = 'block';
      trigger_icon.classList.remove('closed');
      trigger_icon.classList.add('open');
  }
}

window.addEventListener('load', function() {
  // Get trigger button and search bar.
  const gsearch_trigger_btn = document.querySelector('.gsearch-container .g-search-trigger');
  const gsearch_bar = document.querySelector('.gsearch-container > div');

  // Mobile trigger and mobile search bar.
  const mobile_gsearch_trigger_btn = document.querySelector('.mobile-gsearch-container .g-search-trigger');
  const mobile_gsearch_bar = document.querySelector('.mobile-gsearch-container > div');

  // Displays desktop search bar.
  gsearch_trigger_btn.addEventListener('click', function() {
    show_search_bar(this, gsearch_bar);
  });

  // Displays mobile search bar.
  mobile_gsearch_trigger_btn.addEventListener('click', function() {
    show_search_bar(this, mobile_gsearch_bar);
  });

  /* Setting placeholder text for input field since HTML
      is generated dynamically */
  gsearch_bar.querySelector('input').setAttribute('placeholder', 'Search...');
  mobile_gsearch_bar.querySelector('input').setAttribute('placeholder', 'Search...');
});